const MainPage = () => {
  return (
    <div className="flex h-full w-full flex-wrap justify-center">
      <div className=" flex h-12 w-full select-none items-center justify-center bg-slate-100 shadow-md">
        <img src="logo.png" alt="" srcset="" className="relative mt-6 h-20 w-24" />
        <h1 className="font-roboto text-2xl font-extrabold italic tracking-tighter text-slate-600">Amazing Web Scraper</h1>
      </div>
      <div className="mt-56 flex h-[50vh] w-full justify-center bg-slate-200">
        <div className="ml-1 mr-1 flex h-full w-96 flex-wrap content-start justify-center rounded-lg bg-yellow-300">
          <h1 className="mt-3 font-nunito text-3xl font-normal tracking-tighter">Keyword Generator</h1>

          <div className="mt-6 flex flex-col">
            <h1 className="font-nunito text-sm tracking-wider">Input:</h1>
            <input type="text" name="" id="" className="relative w-72" />
            <button className="mt-1 h-7 w-20 rounded-sm bg-slate-500 font-nunito tracking-wider text-slate-200">Generate</button>
          </div>
        </div>
      </div>
    </div>
  );
};

export default MainPage;
